import React from "react";

export default function Header() {
    return(
        <header>
            <div>
                <span className='logo'>Meal Planner App</span>
                <ul className='navigation'>
                    <li>About us</li>
                    <li>Contacts</li>
                    <button><li>Profile</li></button>
                </ul>
            </div>
            <div className='present'></div>
        </header>

    )
}
